import React from 'react';
import { Card } from 'flowbite-react';
import labubu from '../assets/labubu_christmas.jpeg';

interface Product {
  id: number;
  name: string;
  price: number;
  description: string;
  category: string;
  imageUrl: string;
  stockQuantity: number;
}

const product: Product = {
  id: 1,
  name: 'Labubu (Christmas Edition)',
  price: 10,
  description: 'Labubu in christmas outfit.',
  category: 'Toys',
  imageUrl: labubu,
  stockQuantity: 10,
};

const ItemCard = () => {
  return (
    <Card className="w-48 cursor-pointer">
      <img
        src={product.imageUrl}
        alt="Product Image"
        className="w-full h-36 object-cover rounded-t-lg"
      />
      <div className="p-4">
        <h5 className="text-left text-sm font-semibold text-gray-900">
          {product.name}
        </h5>
        <div className="flex items-center justify-between mt-2">
          <span className="text-sm font-bold text-gray-900">$ {product.price}</span>
        </div>
      </div>
    </Card>
  );
};

export default ItemCard;
